import React, { useEffect, useState } from 'react';
import { View, Text, Image, StyleSheet, TouchableOpacity, TextInput } from 'react-native';
import * as SecureStore from 'expo-secure-store';
import { useAuth } from './app/context/AuthContext';  // Update this import if needed
import Btn from './btn';

const API_URL = 'https://dummyjson.com/auth/me';
const TOKEN_KEY = 'abcd123';
interface objects {
    imagelink:string,
    name:string,
    price:number
}
const object1 :objects={
    imagelink:'./assets/wheel.jpg',
    name:"Stylish wheel",
    price:29.99
}
const object2 :objects={
    imagelink:'./assets/led.jpg',
    name:"Blue LED",
    price:9.99
}
const User = () => {

  const { onLogout } = useAuth();
  const [username, setUsername] = useState('');
  const [imagelink, setimagelink] = useState('');
  const [showLogout, setShowLogout] = useState(false); // New state for logout button visibility

  useEffect(() => {
    const fetchData = async () => {
      try {
        const token = await SecureStore.getItemAsync(TOKEN_KEY);
        const response = await fetch(API_URL, {
          method: 'GET',
          headers: {
            Authorization: `Bearer ${token}`,
          },
        });
        const data = await response.json();
        setimagelink(data.image);
        setUsername(data.username);
      } catch (error) {
        console.error('Error fetching user information', error);
      }
    };

    fetchData();
  }, []);
  const intervalId = setInterval(() => {
    
    
  }, 1000); 
intervalId;
  const handleRefresh = () => {
    // Additional refresh actions if needed
  };

  const handlePress = () => {
    onLogout();
    setShowLogout(false); // Hide logout button after logout
    handleRefresh();
  };

  const toggleLogout = () => {
    setShowLogout(!showLogout);
  };

  return (
    <View style={styles.container}>
      {/* Header Section */}
      <View style={styles.header}>
        <TouchableOpacity onPress={toggleLogout}>
          <Image source={{ uri: `${imagelink}` }} style={styles.logo} />
        </TouchableOpacity>
        <Text style={styles.headerText}>Welcome, {username}</Text>
      </View>
  
      {/* Logout Button Section */}
      {showLogout && (
        <View style={styles.logoutContainer}>
          <TouchableOpacity onPress={toggleLogout} style={styles.closeIconContainer}>
            <Text style={styles.closeIcon}>X</Text>
          </TouchableOpacity>
          <Btn textColor={'white'} bgColor={'#f28500'} btnLabel="Logout" onpress={handlePress} />
        </View>
      )}
  
      {/* Search Section */}
      <View style={styles.searchContainer}>
        <TextInput
          style={styles.searchInput}
          placeholder="Search for an object"
          placeholderTextColor="#a9a9a9"
        />
      </View>
  
      {/* Objects Section */}
      <View style={styles.objectsContainer}>
        {/* Object 1 */}
        <View style={styles.objectBox}>
          <Image source={require('./assets/wheel.jpg')} style={styles.objectImage} />
          <Text style={styles.objectTitle}>{object1.name}</Text>
          <Text style={styles.objectPrice}>${object1.price}</Text>
          <TouchableOpacity style={styles.buyButton}>
            <Text style={styles.buyButtonText}>Buy Now</Text>
          </TouchableOpacity>
        </View>
  
        {/* Object 2 */}
        <View style={styles.objectBox}>
          <Image source={require('./assets/led.jpg')} style={styles.objectImage} />
          <Text style={styles.objectTitle}>{object2.name}</Text>
          <Text style={styles.objectPrice}>${object2.price}</Text>
          <TouchableOpacity style={styles.buyButton}>
            <Text style={styles.buyButtonText}>Buy Now</Text>
          </TouchableOpacity>
        </View>
      </View>
    </View>
  );
};

const styles = StyleSheet.create({
    container: {
      flex: 1,
      padding: 16,
      backgroundColor: '#f5f5f5',
      marginTop: 20,
    },
    header: {
      flexDirection: 'row',
      alignItems: 'center',
      justifyContent: 'space-between',
      marginBottom: 16,
    },
    logo: {
      width: 40,
      height: 40,
    },
    headerText: {
      fontSize: 20,
      fontWeight: 'bold',
      marginLeft: 16,
    },
    searchContainer: {
      marginBottom: 16,
    },
    searchInput: {
      height: 40,
      borderWidth: 1,
      borderColor: '#e0e0e0',
      borderRadius: 8,
      paddingLeft: 12,
      fontSize: 16,
      color: '#333',
    },
    objectsContainer: {
      flexDirection: 'row',
      justifyContent: 'space-between',
    },
    objectBox: {
      flex: 1,
      backgroundColor: 'white',
      borderRadius: 8,
      padding: 16,
      marginBottom: 16,
      marginRight: 8,
      alignItems: 'center',
      elevation: 3,
    },
    objectImage: {
      width: '100%',
      height: 150,
      borderRadius: 8,
      marginBottom: 12,
    },
    objectTitle: {
      fontSize: 18,
      marginBottom: 8,
      color: '#333',
      fontWeight: 'bold',
    },
    objectPrice: {
      fontSize: 16,
      marginBottom: 8,
      color: '#f28500',
    },
    buyButton: {
      backgroundColor: '#f28500',
      padding: 12,
      borderRadius: 8,
      marginTop: 'auto',
    },
    buyButtonText: {
      color: 'white',
      fontWeight: 'bold',
      fontSize: 16,
    },
    logoutContainer: {
      position: 'absolute',
      top: 0,
      left: 0,
      right: 0,
      bottom: 0,
      backgroundColor: 'rgba(255, 255, 255, 0.9)',
      alignItems: 'center',
      justifyContent: 'center',
      zIndex: 2,
    },
    closeIconContainer: {
      position: 'absolute',
      top: 10,
      right: 10,
    },
    closeIcon: {
      fontSize: 20,
      fontWeight: 'bold',
      color: '#333',
    },
  });
  

export default User;
